import apple from './images/apple.png'





function whowindow () {
    return (
        <>
            <div className='bg-gray-300 border-solid border-2'>
                <p>я хусос занимаюсь хуйней я долбаеб</p>
            </div>
        </>
    )
}

export default function WhoUs() {
    const image = document.getElementById('apple');
    image.addEventListener('mouseover', function(event) {
        // Отображаем текстовый блок с дополнительной информацией
    const infoBlock = document.createElement('div');
    infoBlock.textContent = 'Это красивая картинка';
    document.body.appendChild(infoBlock);
    });
    return(
        <>
        <img className='hover:-translate-y-5 duration-75' id='apple' src={apple} alt='apple'></img>

        </>
    )}
